import React from 'react';
import { Timeline } from 'react-twitter-widgets'
const Suport = (props) => {
  return (
    <div>
  <Timeline
    dataSource={{
      sourceType: 'CriptoNoticias',
      screenName: 'twitterdev'
    }}
    options={{
      username: 'TwitterDev',
      height: '800'
    }}
    onLoad={() => console.log('Timeline is loaded!')}
  />
    </div>
  )
}

export default Suport;
